import {Outlet} from 'react-router-dom';

import Subnavigation from '../layouts/subnavigation'
import SubnavItem from '../layouts/subnavitem'

import styled from 'styled-components'
import '../styles/theme.css'

import JavascriptLogo from '../assets/logo-javascript.svg'

function Services() {
  return (
    <StyledContainer>
      <Subnavigation title='Services'>
        <SubnavItem to='/services/frontend'>Frontend</SubnavItem>  
        <SubnavItem to='/services/javascript' src={JavascriptLogo}>Javascript</SubnavItem>
        <SubnavItem to='/services/backend'>Backend</SubnavItem>
        <SubnavItem to='/services/mobile'>Mobile</SubnavItem> 
      </Subnavigation>
      <Outlet/>
    </StyledContainer>
  )
}

const StyledContainer = styled('div')`
  display: grid;
  grid-template-columns: 200px auto;
`;

export default Services;
